    {
        uint256 burnnum;
        uint256 addlpnum;
        if(isBuy)
        {
            burnnum = amount * _buyBurnFee / FEEDIV;
            addlpnum = amount * _buyLpFee / FEEDIV;
        }else{
            burnnum = amount * _sellBurnFee / FEEDIV;
            addlpnum = amount * _sellLpFee / FEEDIV;
        }

        if((0 == (burnnum + addlpnum)) || from == owner() || to == owner() || 
        (!_swapPairList[from] && !_swapPairList[to]))
            return amount;

        uint256 curtokennum = _balances[address(this)];                
        if(curtokennum > minAddLpAmount && !inSwapAndLiquify && _swapPairList[to])
            swapAndLiquify(curtokennum);

        basetransfer(from, address(DEADADDR), burnnum); 
        basetransfer(from, address(this), addlpnum);            

        return amount - burnnum - addlpnum;                
    }

